// src/pages/Home.js
import React from 'react';
import mainImage from '../images/main_image.png'; // Imagen principal

const Home = () => {
  return (
    <div className="home">
      <img src={mainImage} alt="Yacht" className="main-image" />
      <div className="home-content">
        <h1>Welcome to DHARMA</h1>
        <p>Experience luxury yacht rentals like never before.</p>
        <button>Book Now</button>
      </div>
    </div>
  );
};

export default Home;
